    public final int getScopeUbound() { return SCOPE_UBOUND; }
    public final int getScopeSize() { return SCOPE_SIZE; }
    public final int getMaxNameLength() { return MAX_NAME_LENGTH; }

    public final static int
           NUM_STATES        = 524,
           NT_OFFSET         = 123,
           LA_STATE_OFFSET   = 5798,
           MAX_LA            = 2147483647,
           NUM_RULES         = 533,
           NUM_NONTERMINALS  = 195,
           NUM_SYMBOLS       = 318,
           SEGMENT_SIZE      = 8192,
           START_STATE       = 2735,
           IDENTIFIER_SYMBOL = 0,
           EOFT_SYMBOL       = 119,
           EOLT_SYMBOL       = 119,
           ACCEPT_ACTION     = 4868,
           ERROR_ACTION      = 5265;

